    const {id, title, photo, price, featured, avgRating, reviews } = tour

    return <div className="tour__card">
        <Card>
        <div className="tour__img"> 
            <img src={photo} alt=""/>
            <span></span>
        </div>

        </Card>
    </div>;

};
export default TourCard;
